import {Link} from 'react-router-dom';

const Product = () => {
  return (
    <div className="product">
      <img 
      src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSk_5GHW1Ms3ftphhuoMu_aE8Ge2oYTOIb0Dw&usqp=CAU"
         alt="..khggg/" />
      <div className="product__info">
        <p className="info__name">product1</p>

        <p className="info__description">description:"L'aloé vera est une plante d'intérieur décorative, facile d'entretien et peu exigeante tout au long de l'année. Elle es utilisée pour ses vertus médicinales. </p>

        <p className="info__price">$50</p>
        <Link to={'/product/${111}'} className="info_button">view
        </Link>
    </div>
    </div>
  )
};

export default Product;
